import React , { Fragment }  from 'react';
import Nav from '../layout/Nav';
import Register from '../pages/Register';

const Home = () => {
    const reg = true;
    return (
        <Fragment>
            <Nav />
            <br/><br /><br/>
            <div className="container">
                {reg &&
                    <Register />
                }
            </div>
        </Fragment>
    )
}

export default Home
